import React from "react";
import './signture.css'
const SIGNIN =()=>{
return(
<>
<div className="signtureItem in ">
            <h1 className="HeaderSignture">Sign In</h1>
            <form action="" className="formCon">
            <input type="text" placeholder="User Name" />
            {/* <p className="error">error user name</p> */}
            <input type="password" placeholder="Enter Password" />
            {/* <p className="error">error password</p> */}
            <input
              type="password"
              placeholder="Confirm Password"
              className="coonz"
            />
            {/* <p className="error">error confirm password</p> */}
            <div className="button">
           <button className="signtureBtn">Sign In</button>
            </div>
            <div className="forget-parent">
              {/* <p className="forget">Forget password?</p> */}
            </div>


            </form>
     
            </div>

    </>);
}
export default SIGNIN;
